export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:e,pageSize:25,pageCount:e,total:5}}},TAq1xXww5H:{data:{id:712,attributes:{imdbId:"tt0092796",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BN2QwZTMzODktNzRiYS00Y2JiLTk5ZmMtOGIwYTE1YTIyOTQ4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"},{Source:"Rotten Tomatoes",Value:"29%"},{Source:"Metacritic",Value:"39\u002F100"}],item_lang:{data:{id:1375,attributes:{title:"Creepshow 2",plot:"\"Creepshow 2\" is divided into three stories, conducted by a leading segment where a boy that loves the horror comic book Creepshow buys seeds of carnivorous plant and is bullied by four teenagers. Meanwhile the Creep tells the tales of Creepshow: (1) \"Old Chief Wood'nhead\" - The elders Ray (George Kennedy) and Martha Spruce (Dorothy Lamour) have lived their whole life and raised their family with their small store in an Arizona town. Now the town is economically decadent and Ray gives credit to his customers; including the Indians of Ben Whitemoon's tribe. When Ray is repairing the wooden statue of an old chief in the front door, Ben (Frank Salsedo) arrives and asks him to keep the jewels of his tribe as a guarantee for their debts. However, Ben's nephew Sam (Holt McCallany) unexpectedly arrives with two other punks to steal Ray, and he kills the elders. They expect to travel to Hollywood, but the Old Chief Wood'nhead will not let them go. (2) \"The Raft\" - The teenagers Deke (Paul Satterfield) and Randy (Daniel Beer) travel with Laverne (Jeremy Green) and Rachel (Page Hannah) to a lake expecting to smoke weed, swim and get laid. They swim to a raft that is floating in the middle of the lake, but they discover a carnivorous blob in the lake that is hungry. (3) \"The Hitchhiker\" - In Maine, the unfaithful Annie Lansing (Lois Chiles) stays too long having sex with her escort and is late to meet her husband in the airport. She drives her Mercedes Benz in a hurry and loses control on the road. Annie runs over a hitchhiker, but she does not help the man and hit-and-run, questioning whether she can live with the situation. She discovers that the hitchhiker will not leave her.",slug:"creepshow-2"}}},books:{data:[{id:4647,attributes:{title:"Stephen King, American Master",description:"Fascinating facts, trivia, and little-known details about the Master of the Macabre’s life from the “world’s leading authority on Stephen King” (Entertainment Weekly). New York Times–bestselling author Stephen Spignesi has compiled interviews, essays, and loads of facts and details about all of Stephen King’s work into this fun and informative compendium for the author’s many fans, from the casual to the fanatical! Did you know. . . ? In his early teens, Stephen King sold typed copies of his short stories at school. King originally thought his novel Pet Sematary was too frightening to publish. King’s legendary Dark Tower series took him more than 30 years to write. Thinner was the novel that revealed his “Richard Bachman” pseudonym to the world. King wrote The Eyes of the Dragon for his daughter Naomi. He has never liked Stanley Kubrick’s film version of his novel The Shining. It took him four years to write what some consider his magnum opus, IT. The 2017 film version of IT has grossed more than $700 million worldwide. In addition to novels, King has written essays, plays, screenplays, and even poetry.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uMhyDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Stephen Spignesi"],firstBook:true,published:"2018-10-30",publisher:"Permuted Press+ORM",subtitle:"A Creepy Corpus of Facts About Stephen King & His Work"}},{id:4648,attributes:{title:f,description:"Provides information on Stephen King's background, published and unpublished works, and motion picture adaptations, and includes interviews and indexes of characters and places",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QM-TDlYLEsIC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:b,published:g,publisher:"McGraw-Hill\u002FContemporary",subtitle:"The Definitive Guide to the Works of America's Master of Horror"}},{id:4649,attributes:{title:"The Shape Under the Sheet",description:"This reference source on Stephen King's fiction provides details about characters, places and objects in each of King's novels and short stories and includes a biography section, interviews with family, friends and contemporaries, and sections on film adaptations and audio versions of his work.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wHUaAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:b,published:g,publisher:"Popular Culture Ink",subtitle:f}},{id:4650,attributes:{title:"Skeleton Crew",description:"Hold tight. We are going into a number of dark places, but I think I know the way. Just don't let go of my arm . . . Unrivalled master of suspense Stephen King takes the unsuspecting reader on a fantastic journey through the dark shadows of our innermost fears. Do the dead sing? In this bumper collection of chilling tales, which includes the brilliant story adapted into the acclaimed movie The Mist, we meet: a woman who has never crossed The Reach, the water dividing her from the mainland; a gramma who only wants to hug little George, even after she is dead; an innocent looking toy with sinister powers; and a primeval sea creture with an insatiable appetite.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qUcVKQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Stephen King"],firstBook:b,published:"2012-01-01",publisher:"Hodder Paperbacks",subtitle:h}},{id:4651,attributes:{title:"The Stephen King Quiz Book",description:"More than one hundred quizzes and 1,500 questions test readers' knowledge of the works of Stephen King, offering puzzles and questions about the master of horror, his novels, short stories, and films",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ut1MbBSDJ-EC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:b,published:"1990-01-01",publisher:"Signet Book",subtitle:h}}]}}},meta:{}}},prerenderedAt:1681309465407}}("movie",null,"Stephen J. Spignesi","series",1,"The Complete Stephen King Encyclopedia","1991-01-01",""))